INSERT INTO `authors` (`id`, `first_name`, `last_name`, `description`, `image`) VALUES
(1, 'Ursula K.', 'Le Guin', 'Ursula Kroeber Le Guin (October 21, 1929 â€“ January 22, 2018) was an American author best known for her works of speculative fiction, including science fiction works set in her Hainish universe, and the Earthsea fantasy series. She was first published in 1959, and her literary career spanned nearly sixty years, producing more than twenty novels and over a hundred short stories, in addition to poetry, literary criticism, translations, and children\'s books. Frequently described as an author of science fiction, Le Guin has also been called a \"major voice in American Letters\". Le Guin said she would prefer to be known as an \"American novelist\".', );
INSERT INTO `authors` (`id`, `first_name`, `last_name`, `description`, `image`) VALUES
(2, 'Stephen', 'King', 'Stephen Edwin King (born September 21, 1947) is an American author of horror, supernatural fiction, suspense, crime, science-fiction, and fantasy novels. Described as the \"King of Horror\", a play on his surname and a reference to his high standing in pop culture, his books have sold more than 350 million copies, and many have been adapted into films, television series, miniseries, and comic books. King has published 64 novels, including seven under the pen name Richard Bachman, and five non-fiction books. He has also written approximately 200 short stories, most of which have been published in book collections', );
INSERT INTO `authors` (`id`, `first_name`, `last_name`, `description`, `image`) VALUES
(6, 'J. K.', 'Rowling', 'Joanne Rowling (born 31 July 1965), also known by her pen name J. K. Rowling, is a British author and philanthropist. She wrote Harry Potter, a seven-volume children\'s fantasy series published from 1997 to 2007. The series has sold over 600 million copies, been translated into 84 languages, and spawned a global media franchise including films and video games. The Casual Vacancy (2012) was her first novel for adults. She writes Cormoran Strike, an ongoing crime fiction series, under the alias Robert Galbraith.', );

